var maximumCandies = function(candies = [], k) {
    
  let max = Math.max(...candies),count = 0
  let nearesMid = 0
  const getCount = (max)=>{
   
      count = 0
      for(let i = 0 ; i < candies.length;i++){
        count = count + Math.floor(candies[i]/max)
      }
    
      return count
    
  }
  const modifiedBs = (start,end)=>{
    if(start>end){
      return 
    }
    let mid = Math.floor((start+end)/2)
    let count = getCount(mid)
    if(count>k){
      nearesMid = mid
      return modifiedBs(mid+1,end)
    }
    else if(count<k){
      return  modifiedBs(start,mid-1)
    }
    else {
      nearesMid = mid
      return modifiedBs(mid+1,end)
    }
     
    
  }
  modifiedBs(0,max)
  let tempc = 0,flag = 0
  while(true){
    tempc = getCount(nearesMid)
    if(tempc<k){
      flag = 1
      break
    }
    nearesMid++
  }
  return flag ===1?nearesMid-1:nearesMid
 
};
